				if (top < viewport.t) {
					top = pos.top + target.offsetHeight;
				}
				if (left + root_element.offsetWidth > viewport.l + viewport.w) {
					left = pos.left - root_element.offsetWidth;
				}
				if (left < viewport.l) {
					left = pos.left + target.offsetWidth
				}
